import "./App.css";
import React from "react";
import TemporaryDrawer from "./Components/TemporaryDrawer";
import Home from "./Pages/Home";
import Background from "./Pages/Background";
import Contact from "./Components/Contact";
import Footer from './Components/Footer';
import Skill from "./Components/Skills";

function App() {
  return (
    <div className="App">

      <TemporaryDrawer />
      <Home />
      <div>Phrase d'intro</div>
      <div>My Skills / Soft and More et bouton pour voir plus</div>
      <div>My background</div>
      <div>Some project I have worked on</div>
      <div>Contact</div>
      <Skill />
      <Background />
      <Contact />
      <Footer />

    </div>
  );
}

export default App;
